import React from 'react';
import Android from '../images/appdev/img_android.png';
import Ios from '../images/appdev/img_ios.png';
import Reactnative from '../images/appdev/img_reactnative.png';
import Flutter from '../images/appdev/img_flutter.png'

export const AppList = [
    {   
        id:"1",
        name:"Android",
        source:Android,
        url:"www.hackerrank.com",
    },
    {   
        id:"2",
        name:"IOS",
        source:Ios,
        url:"www.hackerearth.com",
    },
    {   
        id:"3",
        name:"React Native",
        source:Reactnative,
        url:"www.codechef.com",
    },
    {   
        id:"4",
        name:"Flutter",
        source:Flutter,
        url:"www.geeksforgeeks.com",
    },
]
